import React, { useState } from "react";
import useSound from "use-sound";
import "../styles/navbar.css";

import gorristerYell from "../sounds/gorrister.mp3";
import bennyYell from "../sounds/benny.mp3";
import tedYell from "../sounds/ted.mp3";
import ellenYell from "../sounds/ellen.mp3";
import nimdok from "../sounds/nimdok.mp3";
import cogitoErgoSum from "../sounds/CogitoErgoSum.mp3";

function Header() {
  const [isPlaying, setIsPlaying] = useState(false);
  const [isNavOpen, setIsNavOpen] = useState(false);

  const sounds = {
    AM: useSound(cogitoErgoSum, { onend: () => setIsPlaying(false), interrupt: true })[0],
    Nimdok: useSound(nimdok, { onend: () => setIsPlaying(false), interrupt: true })[0],
    Ellen: useSound(ellenYell, { onend: () => setIsPlaying(false), interrupt: true })[0],
    Gorrister: useSound(gorristerYell, { onend: () => setIsPlaying(false), interrupt: true })[0],
    Benny: useSound(bennyYell, { onend: () => setIsPlaying(false), interrupt: true })[0],
    Ted: useSound(tedYell, { onend: () => setIsPlaying(false), interrupt: true })[0],
  };

  const handleMouseOver = (characterName) => {
    if (!isPlaying && sounds[characterName]) {
      setIsPlaying(true);
      sounds[characterName]();
    }
  };

  const handleToggleNav = () => {
    setIsNavOpen(!isNavOpen);
  };

  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
      <div className="container-fluid">
        <a className="navbar-brand" href="/">
          <img src={process.env.PUBLIC_URL + "/favico.ico"} alt="" width="30" height="24" />
        </a>
        <button
          className="navbar-toggler"
          type="button"
          aria-controls="navbarSupportedContent"
          aria-expanded={isNavOpen}
          aria-label="Toggle navigation"
          onClick={handleToggleNav}
        >
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className={`collapse navbar-collapse ${isNavOpen ? 'show' : ''}`} id="navbarSupportedContent">
          <ul className="navbar-nav mr-auto">
            <li className="nav-item">
              <a className="nav-link" aria-current="page" href="/">Accueil</a>
            </li>
            <li className="nav-item">
              <a className="nav-link" aria-current="page" href="/">Histoire</a>
            </li>
            <li className="nav-item dropdown">
              <a className="nav-link dropdown-toggle" href="/" id="navbarDropdownMenuLink" role="button" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                Personnages
              </a>
              <ul className="dropdown-menu" aria-labelledby="navbarScrollingDropdown">
                <li><span className="h5">Antagoniste</span></li>
                <li><a href="/" className="dropdown-item" onMouseOver={() => handleMouseOver("AM")}>A.M</a></li>
                <li><div className="dropdown-divider" /></li>
                <li><span className="h5">Protagonistes</span></li>
                <li><a href="/" className="dropdown-item" onMouseOver={() => handleMouseOver("Ted")}>Ted</a></li>
                <li><a href="/" className="dropdown-item" onMouseOver={() => handleMouseOver("Ellen")}>Ellen</a></li>
                <li><a href="/" className="dropdown-item" onMouseOver={() => handleMouseOver("Nimdok")}>Nimdok (Maldonado)</a></li>
                <li><a href="/" className="dropdown-item" onMouseOver={() => handleMouseOver("Benny")}>Benny</a></li>
                <li><a href="/" className="dropdown-item" onMouseOver={() => handleMouseOver("Gorrister")}>Gorrister</a></li>
              </ul>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
}

export default Header;
